if (postData.comments && Array.isArray(postData.comments)) {
  postData.comments.forEach(comment => {
    results.push({
      json: {
        text: comment.text,
        username: comment.ownerUsername,
        full_name: comment.ownerFullName,
        profile_link: comment.url || '',
        post_url: postData.url,
        post_message: postData.message,
        source: 'Facebook_Comment',
        platform: 'Facebook'
      }
    });
  });
}

return results;

const items = $input.all();
const results = [];

for (const item of items) {
  let data = item.json;
  let source = data.source || 'Unknown';
  if (!source && data.twitter_lang) source = 'X';
  if (!source && data.placeId) source = 'Google_Maps';
  if (!source && data.videoUrl) source = 'TikTok';
  if (!source && data.url && data.url.includes('linkedin')) source = 'LinkedIn';

  let text = data.text || data.caption || data.message || data.snippet || data.title || '';
  text = text.replace(/\s+/g, ' ').trim();
  if (text.length < 10) continue;

  let hash = text.replace(/\s+/g, '').trim();
  hash = hash.split('').reduce((a,b)=>{a=((a<<5)-a)+b.charCodeAt(0);return a&a},0).toString();

  let name = data.full_name || data.name || data.username || 'Unknown';
  let profile = data.profile_link || data.url || data.permalink || '';

  results.push({
    json: {
      raw_text: text,
      source: source,
      platform: data.platform || source,
      author_name: name,
      profile_url: profile,
      post_url: data.post_url || '',
      content_hash: hash,
      captured_at: new Date().toISOString()
    }
  });
}

return results;

